import React from 'react';
import { Box, Typography, Link, Divider, Grid } from '@mui/material';

function Footer() {
    return (
        <Box
            component="footer"
            sx={{
                backgroundColor: '#f1f1f1', // Slightly darker for contrast
                padding: '20px 0',
                textAlign: 'center',
                boxShadow: '0px -2px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow at the top
            }}
        >
            <Grid container justifyContent="center" spacing={2}>
                <Grid item>
                    <Link
                        href="/"
                        color="inherit"
                        underline="none"
                        sx={{
                            fontSize: '16px',
                            color: '#555', // Slightly darker gray for links
                            fontWeight: '500', // Bolder text for emphasis
                        }}
                    >
                        Home
                    </Link>
                </Grid>
                <Grid item>
                    <Typography
                        sx={{
                            fontSize: '16px',
                            color: '#555', // Match link color for consistency
                        }}
                    >
                        |
                    </Typography>
                </Grid>
                <Grid item>
                    <Link
                        href="/about"
                        color="inherit"
                        underline="none"
                        sx={{
                            fontSize: '16px',
                            color: '#555',
                            fontWeight: '500',
                        }}
                    >
                        About
                    </Link>
                </Grid>
                <Grid item>
                    <Typography
                        sx={{
                            fontSize: '16px',
                            color: '#555',
                        }}
                    >
                        |
                    </Typography>
                </Grid>
                <Grid item>
                    <Link
                        href="/flights"
                        color="inherit"
                        underline="none"
                        sx={{
                            fontSize: '16px',
                            color: '#555',
                            fontWeight: '500',
                        }}
                    >
                        Flights
                    </Link>
                </Grid>
            </Grid>

            <Divider
                sx={{
                    backgroundColor: '#ddd',
                    my: 2,
                    width: '60px',
                    margin: '10px auto',
                }}
            />

            <Typography
                variant="body2"
                sx={{
                    fontSize: '14px',
                    color: '#777', // Softer gray for less emphasis
                    marginBottom: '4px',
                }}
            >
                John St, Hawthorn, VIC 3122, Australia
            </Typography>
            <Typography
                variant="body2"
                sx={{
                    fontSize: '14px',
                    color: '#777',
                }}
            >
                Â© 2024 Kamikaze Company. All rights reserved.
            </Typography>
        </Box>
    );
}

export default Footer;
